import { useParams, useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
import axios from "axios";
import ResponseBox from "../Components/ResponseBox";
import "./SupportDashboard.css";

const TicketDetailPage = () => {
  const { ticketId } = useParams();
  const [ticket, setTicket] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchTicketDetail = async () => {
      try {
        const token = localStorage.getItem("token");
        const res = await axios.get(`http://localhost:5094/api/ticket/${ticketId}`, {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });
        setTicket(res.data);
      } catch (err) {
        console.error("Ticket detay alınamadı", err);
      }
    };

    fetchTicketDetail();
  }, [ticketId]);

  if (!ticket) return <div>Yükleniyor...</div>;

  return (
    <div className="support-container">
      {/* Sidebar */}
      <div className="sidebar">
        <div className="logo">HelpDesk</div>
        <ul className="nav">
          <li onClick={() => navigate('/ticket-list')} style={{ cursor: 'pointer' }}>
            <span className="icon">🎫</span> <span className="label">Tickets</span>
          </li>
          <li>
            <span className="icon">👥</span> <span className="label">Agents</span>
          </li>
          <li>
            <span className="icon">⚙️</span> <span className="label">Settings</span>
          </li>
        </ul>
        <div className="profile">
          <img src="https://i.pravatar.cc/40" alt="user" />
          <span>Kullanıcı</span>
        </div>
      </div>

      {/* Main Content */}
      <div className="main-content">
        <div className="flex gap-6">
          {/* Mesajlaşma Alanı */}
          <div className="w-2/3">
            <h2 className="text-2xl font-bold mb-2">Mesajlar</h2>
            <ResponseBox ticketId={ticketId} />
          </div>

          {/* Ticket Detayları */}
          <div className="w-1/3 bg-white border rounded p-4 shadow">
            <h3 className="text-xl font-semibold mb-2">Ticket Bilgileri</h3>
            <p><strong>Başlık:</strong> {ticket.title}</p>
            <p><strong>Açıklama:</strong> {ticket.description}</p>
            <p><strong>Oluşturan:</strong> {ticket.user?.name || "Bilinmiyor"}</p>
            <p><strong>Oluşturulma Tarihi:</strong> {new Date(ticket.createdAt).toLocaleString()}</p>
            <p><strong>Kategori:</strong> {ticket.category?.name || "Belirtilmemiş"}</p>
            <p><strong>Öncelik:</strong> {ticket.priority?.name || "Belirtilmemiş"}</p>
            <p><strong>Durum:</strong> {ticket.status}</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default TicketDetailPage;
